public static function json(folderName:String, fileName:String, data:Dynamic) : Void
{
    var _path = Sys.getCwd() + '/$folderName/';
    if(! sys.FileSystem.exists( _path ) ){
        sys.FileSystem.createDirectory( _path );
    }

    if(!sys.FileSystem.exists(_path)){
         try {
            throw "Error";
